import React from 'react';
import {Multiselect} from 'multiselect-react-dropdown';

// import './../../style/UMultiselectStyle.css';
/**
 * Select Dropdowns will fill the width of their container
 *
 * @required props:
 *    options // the list the dropdown will contain
 *    onChange
 *
 * @optional props:
 *    placeholder // defaults to 'Choose...'
 *
 */

export default (props) => {
    const options = () => {
        let items = [];
        if (props.options) {
            for (let i = 0; i < props.options.length; i++) {
                items.push({name: props.options[i], id: i});
            }
        }
        console.log(items);
        return items;
    };

    return (
        // <div className='select-container'>
        <Multiselect
            options={[
                {name: 'Srigar', id: 1},
                {name: 'Sam', id: 2},
            ]} // Options to display in the dropdown
            selectedValues={[]} // Preselected value to persist in dropdown
            onSelect={() => {}} // Function will trigger on select event
            onRemove={() => {}} // Function will trigger on remove event
            displayValue='Test' // Property name to display in the dropdown options
        />
        // </div>
    );
};
